import React, { useEffect, useState } from "react";
import { DataMenu } from "../../Apimenu";
import { NavLink } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { cartActions } from "../../store/card";
const Offer = () => {
  const cartItems = useSelector((state) => state.cart.itemsList);
  const quantity = useSelector((state) => state.cart.totleQuantity);
  const [record, setRecord] = useState([]);
  const dispatch = useDispatch();
  const AddItem = (val) => {
    const {name,id,price,image,category}=val;
    dispatch(cartActions.addToCart({
      name,
      id,
      price,
      image,
      category,
    }))
  }
  useEffect(() => {
    const filterData = DataMenu.filter((data) => {
      return "SpecialDish" == data.category
    })
    setRecord(filterData);
  }, [setRecord])

  return (
    <>
      <section classNameName="offer-section">
        <div classNameName="container">
          <div classNameName="row">
            <div classNameName="border flex">
              <div classNameName="sub-border"></div>
              <div classNameName="sub-border"></div>
              <div classNameName="sub-border"></div>
              <div classNameName="sub-border"></div>
              <div classNameName="sub-border"></div>
            </div>
            <div classNameName="buy">
              <NavLink to="/cartlist"><button><h5>{quantity}</h5><i className="fa-solid fa-cart-shopping"></i></button></NavLink>
            </div>
            <div classNameName="content">
              <div classNameName="heading">
                <span>today offer</span>
                <h1>special Items</h1>
              </div>
              <div classNameName="main-cart flex">
                {
                  record && record.map((val) => {
                    const { id, price, name, image, category } = val;

                    return (
                      <div classNameName="cart" key={id}>
                        <div classNameNameName="content" >
                          <div classNameName="image">
                            <div classNameName="title">
                              <h5>availabel</h5>
                            </div>                          
                            <div classNameName="addtocart">
                              <button onClick={() => AddItem(val)}>Add to cart</button>
                            </div>
                            <div classNameName="btn flex">
                              <NavLink to={`/addtocart/${id}`}>Order</NavLink>
                            </div>
                            <img src={image} alt="" />
                          </div>
                          <div classNameName="details flex">
                            <ul classNameName="flex">
                              <li><i className="fa-solid fa-star"></i></li>
                              <li><i className="fa-solid fa-star"></i></li>
                              <li><i className="fa-solid fa-star"></i></li>
                              <li><i className="fa-solid fa-star"></i></li>
                              <li><i className="fa-solid fa-star"></i></li>
                            </ul>
                            <p>{name}</p><span>₹{price}</span>
                          </div>
                        </div>
                      </div>
                    )
                  })
                }
              </div>
            </div>
          </div>
        </div>
      </section>

    </>
  );
}
export default Offer;
